import React from 'react';
import './TableEvento.css'
import editPen from '../../../assets/images/edit-pen.svg'
import trashDelete from '../../../assets/images/trash-delete.svg'

const TableEvento = ({ dados, fnUpdate, fnDelete }) => {
    return (
        <table className='table-data' key={dados.IdEvento}>
            <thead className="table-data__head">
                <th className="table-data__head-title table-data__head-title--little">Evento</th>
                <th className="table-data__head-title table-data__head-title--little">Descrição</th>
                <th className="table-data__head-title table-data__head-title--little">Tipo Evento</th>
                <th className="table-data__head-title table-data__head-title--little">Data</th>
                <th className="table-data__head-title table-data__head-title--little">Editar</th>
                <th className="table-data__head-title table-data__head-title--little">Deletar</th>
            </thead>

            {dados.map(ev => {
                return (
                    <tbody>

                        <tr className="table-data__head-row">

                            <td className="table-data__data table-data__data--little">
                                {ev.nomeEvento}
                            </td>

                            <td className='table-data__data table-data__data--little'>
                                {ev.descricao}...
                            </td>

                            <td className='table-data__data table-data__data--little'>
                                {ev.idTipoEvento}
                            </td>

                            <td className='table-data__data table-data__data--little'>
                                {ev.dataEvento}
                            </td>

                            <td className='table-data__data table-data__data--little'>
                                <img src={editPen} alt="Imagem de lápis para editar o evento."
                                    onClick={() => fnUpdate(ev.idEvento)} />
                            </td>

                            <td className='table-data__data table-data__data--little'>
                                <img src={trashDelete} alt="Imagem de lixeira para deletar o evento."
                                    onClick={() => fnDelete(ev.idEvento)} />
                            </td>

                        </tr>

                    </tbody>
                )
            })}

        </table>
    );
};

export default TableEvento;
